note_models.css:
.card {
  font-family: helvetica neue;
  font-size: 14px;
  line-height: 200%;
}

.section-1 {
  box-shadow: 0 0 1px 0px rgba(0, 0, 0, 0.7);
  border-radius: 2px;
  text-align: center;
  margin: 20px 10px 0 10px;
  padding: 10px 18px 10px 18px;
}

.section-2 {
  box-shadow: 0 0 1px 0px rgba(0, 0, 0, 0.7);
  border-radius: 2px;
  text-align: left;
  margin: 20px 10px 0 10px;
  padding: 10px 18px 10px 18px;
}

.section-3 {
  box-shadow: 0 0 0px 0px rgba(0, 0, 0, 0.7);
  border-radius: 2px;
  text-align: center;
  font-weight: bold;
  margin: 20px 10px 0 10px;
  padding: 10px 18px 10px 18px;
}

.word-list {
  font-size: 13px;
  line-height: 100%;
  border-left-style: solid;
  border-width: 4px;
  margin-left: 10px;
  padding-left: 8px;
}

.eudic {
  font-size: 13px;
  margin-right: 10px;
}

.word {
  text-align: center;
  font-weight: bold;
  font-size: 30px;
  padding: 20px 0 4px 0;
}

.pos {
  text-align: center;
  font-size: 14px;
  color: #8F8F8F;
  padding: 0 0 8px 0;
}

.definition {
  font-size: 16px;
  margin: 0 0 0 -10px;
}

.example_en {
  font-size: 16px;
}

.example_zh {
  font-weight: 400;
  font-size: 14px;
  color: #8F8F8F;
}

.hightlight{
  font-size: 12px;
  border-radius: 4px;
  color: #fff;
  padding: 0 3px 1px 4px;
  margin: 0 3px 0 8px;
}

a:link {
 text-decoration: none;
 color: #5C5CFF
}

img {
  margin-right: 7px; 
}
